import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faAngleLeft, faan} from "@fortawesome/free-solid-svg-icons"

function Arrows() {
    return (
        <>

        <button type="button" class="btn btn-dark"><FontAwesomeIcon icon={faAngleLeft} />Secondary</button>

        <button type="button" class="btn btn-dark">Secondary</button>
        </>
    );
}

export default Arrows;
